export const MarkIcon = () => {
  return (
    <svg
      aria-hidden="true"
      focusable="false"
      class="udlite-icon udlite-icon-xsmall udlite-icon-color-neutral udlite-block-list-item-icon"
    >
      <use xlinkHref="#icon-tick">
        <svg id="icon-tick" viewBox="0 0 24 24">
          <path d="M9 16.17L4.83 12l-1.42 1.41L9 19 21 7l-1.41-1.41L9 16.17z"></path>
        </svg>
      </use>
    </svg>
  );
};

export const PlayIcon = () => {
  return (
    <svg
      aria-hidden="true"
      focusable="false"
      class="udlite-icon udlite-icon-xsmall udlite-icon-color-neutral udlite-block-list-item-icon"
    >
      <use xlinkHref="#icon-play">
        <svg id="icon-play" viewBox="0 0 24 24">
          <path d="M2 12c0 5.525 4.475 10 10 10s10-4.475 10-10S17.525 2 12 2 2 6.475 2 12zm15 .114L9 16V8l8 4.114z"></path>
        </svg>
      </use>
    </svg>
  );
};

export const ExpandIcon = () => {
  return (
    <svg
      aria-hidden="true"
      focusable="false"
      class="udlite-icon udlite-icon-small udlite-icon-color-neutral panel--expand-icon--1ZzXo"
    >
      <use xlinkHref="#icon-expand">
        <svg id="icon-expand" viewBox="0 0 24 24">
          <path d="M16.59 8.59L12 13.17 7.41 8.59 6 10l6 6 6-6-1.41-1.41z"></path>
        </svg>
      </use>
    </svg>
  );
};

export const PlayPreviewIcon = () => {
  return (
    <svg
      aria-hidden="true"
      focusable="false"
      className="udlite-icon udlite-icon-xxlarge udlite-focus-visible-target"
    >
      <use xlinkHref="#icon-play-overlay">
        <svg id="icon-play-overlay" viewBox="0 0 24 24">
          <circle cy="12" cx="12" fill="#1e1e1c" r="10"></circle>
          <path d="M0 12A12 12 0 1012 0 12 12 0 000 12zm18 .137L8.4 16.8V7.2l9.6 4.937z"></path>
        </svg>
      </use>
    </svg>
  );
};

export const HamburgerIcon = () => {
  return (
    <svg
      aria-hidden="true"
      class="udlite-icon udlite-icon-xsmall udlite-icon-color-neutral udlite-breadcrumb-icon"
    >
      <use xlinkHref="#icon-next">
        <svg id="icon-next" viewBox="0 0 24 24">
          <path d="M8.59 7.41L13.17 12l-4.58 4.59L10 18l6-6-6-6-1.41 1.41z"></path>
        </svg>
      </use>
    </svg>
  );
};

export const IconNew = () => {
  return (
    <svg
      aria-hidden="true"
      className="udlite-icon udlite-icon-xsmall udlite-icon-color-neutral "
    >
      <use xlinkHref="#icon-new">
        <svg id="icon-new" viewBox="0 0 24 24">
          <path d="M23 12l-2.44-2.78.34-3.68-3.61-.82-1.89-3.18L12 3 8.6 1.54 6.71 4.72l-3.61.81.34 3.68L1 12l2.44 2.78-.34 3.69 3.61.82 1.89 3.18L12 21l3.4 1.46 1.89-3.18 3.61-.82-.34-3.68L23 12zm-10 5h-2v-2h2v2zm0-4h-2V7h2v6z"></path>
        </svg>
      </use>
    </svg>
  );
};

export const BulletIcon = () => {
  return (
    <svg
      aria-hidden="true"
      focusable="false"
      class="udlite-icon udlite-icon-xsmall udlite-icon-color-neutral udlite-block-list-item-icon"
    >
      <use xlinkhref="#icon-bullet"></use>
    </svg>
  );
};
